import React from 'react';
import { motion } from 'framer-motion';
import { FaRocket, FaCloud, FaShieldAlt, FaExpandArrowsAlt } from 'react-icons/fa';
import { Link } from 'react-router-dom';

const FeatureIcon = ({ icon: Icon, text }) => (
  <div className="flex items-center space-x-2">
    <Icon className="h-5 w-5 text-indigo-400" />
    <span className="text-sm text-gray-300">{text}</span>
  </div>
);

function Info3() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 to-gray-800 text-white overflow-hidden flex flex-col justify-between py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 w-full flex flex-col h-full">
        {/* Top section with logo and icons */}
        <motion.div 
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="flex justify-between items-center"
        >
          <div className="text-2xl font-bold">TokTok</div>
          <div className="flex space-x-6">
            <FaRocket className="h-6 w-6 text-indigo-400" />
            <FaCloud className="h-6 w-6 text-indigo-400" />
            <FaShieldAlt className="h-6 w-6 text-indigo-400" />
            <FaExpandArrowsAlt className="h-6 w-6 text-indigo-400" />
          </div>
        </motion.div>

        {/* Main content */}
        <div className="flex-grow flex items-center">
          <div className="flex w-full items-center">
            <motion.div
              initial={{ opacity: 0, x: -20 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.8, delay: 0.2 }}
              className="w-1/2 text-left pr-8 flex flex-col justify-center"
            >
              <h1 className="text-4xl tracking-tight font-extrabold sm:text-5xl md:text-6xl">
                <span className="block">Innovate with</span>
                <span className="block text-indigo-400">TokTok Solutions</span>
              </h1>
              <p className="mt-3 text-base text-gray-300 sm:text-lg md:mt-5 md:text-xl max-w-lg">
                Discover how our cutting-edge technology can transform your business and drive growth in the digital age.
              </p>
              <div className="mt-6 space-y-4">
                <FeatureIcon icon={FaRocket} text="Rapid Development" />
                <FeatureIcon icon={FaCloud} text="Cloud-Native Architecture" />
                <FeatureIcon icon={FaShieldAlt} text="Enterprise-Grade Security" />
                <FeatureIcon icon={FaExpandArrowsAlt} text="Scalable Solutions" />
              </div>
              <div className="mt-10 flex">
                <motion.div
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                  className="rounded-md shadow"
                >
                  <Link to="/demo" className="w-full flex items-center justify-center px-8 py-3 border border-transparent text-base font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-700 md:py-4 md:text-lg md:px-10">
                    Request a Demo
                  </Link>
                </motion.div>
                <motion.div
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                  className="ml-3 rounded-md shadow"
                >
                  <Link to="/contact" className="w-full flex items-center justify-center px-8 py-3 border border-transparent text-base font-medium rounded-md text-indigo-600 bg-white hover:bg-gray-50 md:py-4 md:text-lg md:px-10">
                    Contact Sales
                  </Link>
                </motion.div>
              </div>
            </motion.div>
            <motion.div
              initial={{ opacity: 0, x: 20 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.8, delay: 0.4 }}
              className="w-1/2 flex justify-center items-center"
            >
              {/* Replace this with the visual element from your screenshot */}
              <div className="w-full max-w-md bg-gray-800 rounded-xl p-4 shadow-lg h-96">
                <div className="h-full flex items-center justify-center text-indigo-400">
                  <FaRocket className="h-24 w-24" />
                </div>
              </div>
            </motion.div>
          </div>
        </div>

        {/* Bottom section */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.6 }}
        >
          <div className="relative">
            <div className="absolute inset-0 flex items-center" aria-hidden="true">
              <div className="w-full border-t border-gray-700" />
            </div>
            <div className="relative flex justify-center">
              <span className="px-2 bg-gray-900 text-sm text-gray-400">
                Trusted by industry leaders worldwide
              </span>
            </div>
          </div>

          <div className="mt-8 grid grid-cols-2 gap-8 md:grid-cols-6 lg:grid-cols-5">
            {['Client 1', 'Client 2', 'Client 3', 'Client 4', 'Client 5'].map((client, index) => (
              <div key={index} className="col-span-1 flex justify-center md:col-span-2 lg:col-span-1">
                <div className="text-gray-400 font-semibold">{client}</div>
              </div>
            ))}
          </div>
        </motion.div>
      </div>
    </div>
  );
}

export default Info3;
